import react from 'react';

function Detail(){
  return (
    <div className='Detail'>
      <div className="imgContainer">
        <img src={process.env.PUBLIC_URL + './'}/>
      </div>
      <div className="description">
        <h4>상품명</h4>
        <p>상품내용</p>
        <p>120000원</p>
        <button className="orderBtn">주문하기</button>
      </div>
    </div>
  );
};
export default Detail;
